import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  togglePressed = () => {
    document.querySelector('.secondContainer').addEventListener('click',function(e) {
      alert('pressed')
      e.target.classList.toggle('hide');
    })
  }
  render(){
    return (
      <div className="App">
        <div className="container">
          <div className="titleContainer">
            <div className="titleMain">
              <div className="title">
                <p className="titleText">{'Toggle'}</p>
              </div>
              <div onClick={this.togglePressed} className="toggleButton">
                <p className="buttonText">{'Click Me !'}</p>
              </div>
            </div>
          </div>
          <div className="secondContainer">

          </div>
        </div>
      </div>
    );
  }
}

export default App;
